Frank,

Yeah, you do get them talking about you.  It seems like there is a lot of conversation between many voices here and they are talking about calling.  At .08, somebody is tee&#39;d off.  

There is something to labeling affecting subliminal interpretation.  When I read your interpretation of the &quot;jesus&quot; line at the beginning, that is what I heard through the speakers first and foremost.  I turned the speakers off and used studio grade headphones for analysis.  Voila, no Jesus.  I guess he was resurrected from this clip!  I often wonder if the sound waves between speaker and listener are manipulated in some way.  This is why I like to listen in enclosed headphones, that way your ear is directly against the sound source.

That said, this is what I hear from your clip:

@.01: &quot;He&#39;s calling you, he&#39;s a (unclear)&quot; (male, electronic)
@.03: It amounts to scheisse
@.05: &quot;Make sure he has the date&quot; (male)
@.06: &quot;May Eighteenth&quot; (electronic)
@.08: &quot;Fuck this guy&quot; (male)
@.09: Singing - &quot;He doesn&#39;t call her, call her (?anymore?)&quot; (female)
@.12: He doesn&#39;t seem to reply (male)
@.13: Steve (?Coogle? - unclear)

I know you typically don&#39;t interact with the box by asking questions, but have you ever tried telling them to communicate one at a time?   It works for me most of the time when multiple voices crowd the box.  Regardless, they definitely like communicating with you.  I find the electronic voices and tones you get most interesting; they remind me of spiricom audio.

Tim
